import React, { Component } from "react";

const Card = (props) => {
  const imageUrl = props.imgsrc;
  return (
    <div id="card" className="col-lg-4 col-10 mx-auto pl-0 ">
      <div className="box">
        <h3> {props.title}</h3>
        <p className="card-text text-center d-flex justify-content-center">
          {props.text}
        </p>

        <a href={props.url} target="_blank" className="box-button">
          View Code
        </a>
      </div>
    </div>
  );
};

export default Card;
